import React from 'react';
//import logo from './logo.svg';
import imp from './Home.png';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={imp} className="Imp-logo" alt="custom logo" />
        
        
      </header>
    </div>
  );
}

export default App;
